    ,cast(V_LAST_MEASURED_YEAR_FOR_DIA_LMY AS VARCHAR)
    ,cast(V_YIELD_STRENGTH_KSI AS VARCHAR)
    ,cast(V_TENSILE_STREGTH_KSI AS VARCHAR)				
    ,cast(I_EFFICIENCY_OF_WELD_E AS VARCHAR) 
    ,cast(I_YOUNGS_MODULUS_Y AS VARCHAR)     
