    UPDATE "POF_EC" SET "POF" = ROUND(V_POF::NUMERIC, 5), "DamageFactor"=ROUND(V_DAMAGE_FACTOR::NUMERIC, 5), "Art"=ROUND(V_ART::NUMERIC, 5), "StrengthRatio" = ROUND(V_STENGTH_RATIO::NUMERIC, 5) WHERE "EquipmentNo"=I_EQUIPMENT_NO;
